import styled from 'styled-components';
import { Link } from 'react-router-dom';

export const AppBarContainer = styled.div`
  height: 35px;  
  background: $accent-color;
  display: flex;
  justify-content: center;
  align-items: center;
  color: white;
  position: sticky;
  top: -1px;
  z-index: 1600;
  
  `;
